fun match_keyword(id: String) -> TokenType { match id.to_string() { "fun" => TokenType::Fun, "let" => TokenType::Let, "if" => TokenType::If, "while" => TokenType::While, _ => TokenType::Identifier }
} // Helper: Skip whitespace
