} // Tokenize single character operators
fun tokenize_single(input: String, start: i32) -> (Token, i32) { let ch = char_at(input, start); if ch == "=" { let next_ch = char_at(input, start + 1); if next_ch == "=" { (Token::Tok(TokenType::EqualEqual, "==".to_string()), start + 2) } else { (Token::Tok(TokenType::Equal, "=".to_string()), start + 1) } } else if ch == "+" { (Token::Tok(TokenType::Plus, "+".to_string()), start + 1) } else if ch == "-" { (Token::Tok(TokenType::Minus, "-".to_string()), start + 1) } else if ch == "*" { (Token::Tok(TokenType::Star, "*".to_string()), start + 1) } else if ch == "/" { // Check for line comment let next_ch = char_at(input, start + 1); if next_ch == "/" { // Skip until newline let mut idx = start + 2; loop { let c = char_at(input, idx); if c == "\0" || c == "\n" { break; } idx = idx + 1; } tokenize_one(input, idx) // Recurse to get next token } else { (Token::Tok(TokenType::Slash, "/".to_string()), start + 1) } } else { (Token::Tok(TokenType::Error, ch.to_string()), start + 1) }
